import { Component, OnInit } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent {
  firtsname: string = '';
  lastname: string = '';
  email: string = '';
  password: string = '';
  phone: string = '';
  validatePassword: string = '';
  birthdate: string = '';

  constructor(private http: HttpClient) {}

  register() {
    const newUser = { firstname: this.firtsname, lastname: this.lastname, email: this.email, password: this.password, phone: this.phone, birthdate: this.birthdate};
    this.http.post('http://localhost:3000/api/register', newUser)
      .subscribe(
        () => alert('Registro exitoso'),
        (error) => alert('Error al registrar: ' + error.error.message)
      );
  }
}
